import { useState } from 'react';

import logo from './logo.svg';
import './App.css';
import Board from './components/Board.js'
import Game from './components/Game.js'
import Square from  './components/Square.js'

function App() {
  return (
    <div className="App">
      <Board></Board>
      <Game></Game>
      <Square></Square>
    </div>
  );
}

export default App;
